// --- DATABASE KEY CLEANER & LOOKUP MAP BUILDER ---
const cleanSpeciesDB = {};
const commonNameLookup = {}; // NEW: A reverse map for common names

for (const scientificName in internalSpeciesDB) {
    if (Object.hasOwnProperty.call(internalSpeciesDB, scientificName)) {
        const originalData = internalSpeciesDB[scientificName];
        const cleanScientificName = scientificName.trim().toLowerCase();

        // 1. Store the original (cased) scientific name in the data object for later display
        originalData.originalScientificName = scientificName.trim();
        
        // 2. Add to clean DB using lowercase scientific name as key
        cleanSpeciesDB[cleanScientificName] = originalData;
        
        // 3. Build the common name lookup map
        if (originalData.commonName) {
            const commonNames = originalData.commonName.split('|');
            commonNames.forEach(name => {
                const cleanCommonName = name.trim().toLowerCase();
                if (cleanCommonName) {
                    // Map the lowercase common name to the lowercase scientific name
                    commonNameLookup[cleanCommonName] = cleanScientificName;
                }
            });
        }
    }
}
// --- END OF CLEANER ---


