    function populateDatalist() {
        speciesDatalist.innerHTML = '';
        const seen = new Set(); 

        for (const scientificKey in cleanSpeciesDB) {
            const originalName = cleanSpeciesDB[scientificKey].originalScientificName;
            if (originalName && !seen.has(originalName)) {
                const option = document.createElement('option');
                option.value = originalName;
                speciesDatalist.appendChild(option);
                seen.add(originalName);
            }
        }

        for (const commonName in commonNameLookup) {
            const scientificKey = commonNameLookup[commonName];
            const data = cleanSpeciesDB[scientificKey];
            
            if (data.commonName) {
                const originalCommonNames = data.commonName.split('|');
                const originalCasedName = originalCommonNames.find(n => n.trim().toLowerCase() === commonName);
                
                const displayName = originalCasedName ? originalCasedName.trim() : commonName;

                if (displayName && !seen.has(displayName)) {
                    const option = document.createElement('option');
                    option.value = displayName;
                    speciesDatalist.appendChild(option);
                    seen.add(displayName);
                }
            }
        }
    }

